import image4 from "./assets/img4.jpg";
import image5 from "./assets/img5.jpg";
import image6 from "./assets/img6.jpg";

const data2 = {
    productsMid: [
      {
        id: "4",
        name: 4,
        price: 15,
        image: image4,
      },
      {
        id: "5",
        name: 5,
        price: 15,
        image: image5,
      },
      {
        id: "6",
        name: 6,
        price: 15,
        image: image6,
      },
    ],
  };
  export default data2;
